export function aboutContentDataSuccess(aboutContent) {
    return {
        type: "ABOUT_CONTENT_DATA_SUCCESS",
        aboutContent
    }
}

export function aboutContentData(url) {
    return (dispatch) => {
        fetch(url)
            .then(
                response => {
                    if (!response.ok) {
                        throw new Error(response.statusText)
                    }
                    return response
                })
            .then(response => response.json())
            .then(aboutContent => dispatch(aboutContentDataSuccess(aboutContent)))
    }
}
